import React from 'react'

const CourseList = ({ courses, searchTerm }) => {

  return (
    <div className="right-column">
    <h2>Course List</h2>
    <input type="text" placeholder="Search" value={searchTerm} onChange={(e) => { // Handle the input change here if needed
}}
      />
    <table>
      <thead>
        <tr>
          <th>Course Name</th>
          <th>Course Number</th>
          <th>Units</th>
          <th>Grade</th>
        </tr>
      </thead>
      <tbody>
        {courses.map((course, index) => (
          <tr key={index}>
            <td>{course.courseName}</td>
            <td>{course.courseNumber}</td>
            <td>{course.units}</td>
            <td>{course.grade}</td>
          </tr>
        ))}
      </tbody>
    </table>
  </div>
);
}

export default CourseList;
